    "contracts/WingsProtocol.sol": {
      "content": "//SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";

contract WingsProtocol is IERC20, Ownable {
    using SafeMath for uint256;

    address WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    address DEAD = 0x000000000000000000000000000000000000dEaD;
    address ZERO = 0x0000000000000000000000000000000000000000;

    string constant _name = "WingsProtocol";
    string constant _symbol = "XWIP";
    uint8 constant _decimals = 18;

    uint256 _totalSupply = 100000000000 * (10**_decimals);

    uint256 public _maxWalletToken = _totalSupply / 100;

    mapping(address => uint256) _balances;
    mapping(address => mapping(address => uint256)) _allowances;

    mapping(address => bool) isFeeExempt;
    // allowed users to do transactions before trading enable
    mapping(address => bool) isAuthorized;
    mapping(address => bool) isTimelockExempt;
    mapping(address => bool) isBlacklist;
    mapping(address => bool) isMaxWalletExempt;

    // buy fees
    uint256 public buyBuyBackFee = 1;
    uint256 public buyProjectFundFee = 3;
    uint256 public buyLiquidityFee = 1;
    uint256 public buyStakingPoolFee = 2;
    uint256 public buyTotalFees = 7;
    // sell fees
    uint256 public sellBuyBackFee = 2;
    uint256 public sellProjectFundFee = 6;
    uint256 public sellLiquidityFee = 2;
    uint256 public sellStakingPoolFee = 2;
    uint256 public sellTotalFees = 12;

    // swap amount
    uint256 public buyBackSwap = 20;
    uint256 public liquiditySwap = 20;
    uint256 public projectSwap = 60;

    address public buyBackFeeReceiver =
        0x33a2318F9DA904BFfc3375C3a264e055E40f30EE;
    address public stakingPoolFeeReceiver =
        0x6378633a8ADEDb70593369a5E7Ab37662bd2A76f;
    address public projectFundFeeReceiver =
        0xFdE9B2aA3810007e6D6CA4648976D3d2e7262c7F;

    IUniswapV2Router02 public router;
    address public pair;

    bool public tradingOpen = false;
    bool public isGetNormalFees = true;
    // Cooldown & timer functionality
    bool public coolDownEnabled = true;
    uint256 public cooldownTimerInterval = 30;
    mapping(address => uint256) private cooldownTimer;
    event AutoLiquify(uint256 amountBNB, uint256 amountBOG);

    bool public swapEnabled = true;
    uint256 public swapThreshold = (_totalSupply * 10) / 10000; // 0.01% of supply
    bool inSwap;
    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    constructor() {
        router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        pair = IUniswapV2Factory(router.factory()).createPair(
            WBNB,
            address(this)
        );
        _allowances[address(this)][address(router)] = type(uint256).max;

        isFeeExempt[msg.sender] = true;

        isMaxWalletExempt[pair] = true;
        isTimelockExempt[pair] = true;

        isAuthorized[owner()] = true;

        _balances[msg.sender] = _totalSupply;
        emit Transfer(address(0), msg.sender, _totalSupply);
    }

    receive() external payable {}

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function name() public pure returns (string memory) {
        return _name;
    }

    function symbol() public pure returns (string memory) {
        return _symbol;
    }

    function decimals() public pure returns (uint8) {
        return _decimals;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function allowance(address holder, address spender)
        external
        view
        override
        returns (uint256)
    {
        return _allowances[holder][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function approveMax(address spender) external returns (bool) {
        return approve(spender, type(uint256).max);
    }

    function transfer(address recipient, uint256 amount)
        external
        override
        returns (bool)
    {
        return _transferFrom(msg.sender, recipient, amount);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        if (_allowances[sender][msg.sender] != type(uint256).max) {
            _allowances[sender][msg.sender] = _allowances[sender][msg.sender]
                .sub(amount, "Insufficient Allowance");
        }

        return _transferFrom(sender, recipient, amount);
    }

    function _transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        require(
            !isBlacklist[sender] && !isBlacklist[recipient],
            "Blacklisted users"
        );
        if (inSwap) {
            return _basicTransfer(sender, recipient, amount);
        }

        if (!isAuthorized[sender]) {
            require(tradingOpen, "Trading not open yet");
        }
        if (coolDownEnabled && !isTimelockExempt[sender]) {
            require(
                cooldownTimer[sender] < block.timestamp,
                "Please wait for cool down"
            );
            cooldownTimer[sender] = block.timestamp + cooldownTimerInterval;
        }
        if (!isMaxWalletExempt[recipient]) {
            require(
                _balances[recipient].add(amount) <= _maxWalletToken,
                "Max wallet exceed"
            );
        }
        if (shouldSwapBack()) {
            swapBackInBnb();
        }

        //Exchange tokens
        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );

        uint256 amountReceived = shouldTakeFee(sender,recipient)
            ? takeFee(sender, amount, recipient)
            : amount;
        _balances[recipient] = _balances[recipient].add(amountReceived);

        emit Transfer(sender, recipient, amountReceived);
        return true;
    }

    function _basicTransfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function shouldTakeFee(address sender,address to) internal view returns (bool) {
        if(isFeeExempt[sender] || isFeeExempt[to]){
            return false;
        }
        else {
            return true;
        }

    }

    function takeFee(
        address sender,
        uint256 amount,
        address to
    ) internal returns (uint256) {
        uint256 feeAmount = 0;
        uint256 stakePool = 0;
        if (to == pair) {
            feeAmount = amount.mul(sellTotalFees).div(100);
            if (sellStakingPoolFee > 0) {
                stakePool = feeAmount.mul(sellStakingPoolFee).div(
                    sellTotalFees
                );
                feeAmount = feeAmount.sub(stakePool);
            }
        } else if (sender == pair) {
            feeAmount = amount.mul(buyTotalFees).div(100);
            if (buyStakingPoolFee > 0) {
                stakePool = feeAmount.mul(buyStakingPoolFee).div(buyTotalFees);
                feeAmount = feeAmount.sub(stakePool);
            }
        } else if (isGetNormalFees) {
            feeAmount = amount.mul(buyTotalFees).div(100);
            if (buyStakingPoolFee > 0) {
                stakePool = feeAmount.mul(buyStakingPoolFee).div(buyTotalFees);
                feeAmount = feeAmount.sub(stakePool);
            }
        }
        if (stakePool > 0) {
            _balances[stakingPoolFeeReceiver] = _balances[
                stakingPoolFeeReceiver
            ].add(stakePool);
            emit Transfer(sender, stakingPoolFeeReceiver, stakePool);
        }
        if (feeAmount > 0) {
            _balances[address(this)] = _balances[address(this)].add(feeAmount);
            emit Transfer(sender, address(this), feeAmount);
        }

        return amount.sub(feeAmount).sub(stakePool);
    }

    function shouldSwapBack() internal view returns (bool) {
        return
            msg.sender != pair &&
            !inSwap &&
            swapEnabled &&
            tradingOpen &&
            _balances[address(this)] >= swapThreshold;
    }

    function clearStuckBalance(uint256 amountPercentage) external onlyOwner {
        uint256 amountBNB = address(this).balance;
        payable(msg.sender).transfer((amountBNB * amountPercentage) / 100);
    }
    function updateUniswapRouter(address newAddress) public onlyOwner {
        require(
            newAddress != address(router),
            "The router already has that address"
        );

        router = IUniswapV2Router02(newAddress);
        pair = IUniswapV2Factory(router.factory()).createPair(
            WBNB,
            address(this)
        );
    }
    function updateBuyFees(
        uint256 buyBack,
        uint256 projectFee,
        uint256 liquidity,
        uint256 staking
    ) public onlyOwner {
        buyBuyBackFee = buyBack;
        buyProjectFundFee = projectFee;
        buyLiquidityFee = liquidity;
        buyStakingPoolFee = staking;
        buyTotalFees = buyBack.add(projectFee).add(liquidity).add(staking);
    }

    function updateSellFees(
        uint256 buyBack,
        uint256 projectFee,
        uint256 liquidity,
        uint256 staking
    ) public onlyOwner {
        sellBuyBackFee = buyBack;
        sellProjectFundFee = projectFee;
        sellLiquidityFee = liquidity;
        sellStakingPoolFee = staking;
        sellTotalFees = buyBack.add(projectFee).add(liquidity).add(staking);
    }
 // change swap percentage
    function changeSwapAmount(
        uint256 _buyBackSwap,
        uint256 _liquiditySwap,
        uint256 _projectSwap
    ) public onlyOwner {
        buyBackSwap = _buyBackSwap;
        liquiditySwap = _liquiditySwap;
        projectSwap = _projectSwap;
        uint256 totalSwap = _buyBackSwap.add(_liquiditySwap).add(_projectSwap);

        require(totalSwap == 100, "Total swap percentage should equal to 100%");
    }
    // switch Trading
    function tradingStatus(bool _status) public onlyOwner {
        tradingOpen = _status;
    }

    function setGetFeesOnNormalTx(bool _status) public onlyOwner {
        isGetNormalFees = _status;
    }

    function setIsAuthorize(address wallet, bool _status) public onlyOwner {
        isAuthorized[wallet] = _status;
    }

    function blackListWallets(address wallet, bool _status) public onlyOwner {
        isBlacklist[wallet] = _status;
    }

    function exemptTimeLock(address wallet, bool _status) public onlyOwner {
        isTimelockExempt[wallet] = _status;
    }

    function exemptMaxWallet(address wallet, bool _status) public onlyOwner {
        isMaxWalletExempt[wallet] = _status;
    }

    function changeMaxWalletToken(uint256 _amount) public onlyOwner {
        require(
            _amount >= 1000000000,
            "Max wallet amount can not be less than 1%"
        );
        _maxWalletToken = _amount * 10**_decimals;
    }

    function enableSellCollDown(bool _status) public onlyOwner {
        coolDownEnabled = _status;
    }

    function changeSellCoolDownTime(uint256 _time) public onlyOwner {
        require(
            _time <= 3600,
            "sell coll down time can not be greater than 1 hour"
        );
        cooldownTimerInterval = _time;
    }

    function swapBackInBnb() internal swapping {
        uint256 contractTokenBalance = _balances[address(this)];
        uint256 tokensToLiquidity = contractTokenBalance
            .mul(liquiditySwap)
            .div(100);

        // calculate tokens amount to swap
        uint256 tokensToSwap = contractTokenBalance.sub(tokensToLiquidity);
        // swap the tokens
        swapTokensForEth(tokensToSwap);
        // get swapped bnb amount
        uint256 swappedBnbAmount = address(this).balance;

        uint256 totalSwapFee = buyBackSwap.add(projectSwap);
        uint256 projectFundFeeBnb = swappedBnbAmount.mul(projectSwap).div(
            totalSwapFee
        );
        uint256 bnbForBuyBack = swappedBnbAmount.sub(projectFundFeeBnb);

        if (projectFundFeeBnb > 0) {
            (bool marketingSuccess, ) = payable(projectFundFeeReceiver).call{
                value: projectFundFeeBnb,
                gas: 30000
            }("");
            marketingSuccess = false;
        }

        if (bnbForBuyBack > 0) {
            (bool buyBackSenSuccess, ) = payable(buyBackFeeReceiver).call{
                value: bnbForBuyBack,
                gas: 30000
            }("");
            buyBackSenSuccess = false;
        }

        if (tokensToLiquidity > 0) {
            // add liquidity
            swapAndLiquify(tokensToLiquidity);
        }
    }

    function swapAndLiquify(uint256 tokens) private {
        // split the contract balance into halves
        uint256 half = tokens.div(2);
        uint256 otherHalf = tokens.sub(half);

        // capture the contract's current ETH balance.
        // this is so that we can capture exactly the amount of ETH that the
        // swap creates, and not make the liquidity event include any ETH that
        // has been manually sent to the contract
        uint256 initialBalance = address(this).balance;

        // swap tokens for ETH
        swapTokensForEth(half); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance.sub(initialBalance);

        // add liquidity to uniswap
        addLiquidity(otherHalf, newBalance);

        emit AutoLiquify(newBalance, otherHalf);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = router.WETH();
        _approve(address(this), address(router), tokenAmount);
        // make the swap
        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 bnbAmount) private {
        _approve(address(this), address(router), tokenAmount);

        // add the liquidity
        router.addLiquidityETH{value: bnbAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            address(this),
            block.timestamp
        );
    }

    function setIsFeeExempt(address holder, bool exempt) external onlyOwner {
        isFeeExempt[holder] = exempt;
    }

    function setFeeReceivers(
        address _buyBackWallet,
        address _stakingWallet,
        address _projectFundWallet
    ) external onlyOwner {
        buyBackFeeReceiver = _buyBackWallet;
        stakingPoolFeeReceiver = _stakingWallet;
        projectFundFeeReceiver = _projectFundWallet;
    }

    function setSwapBackSettings(bool _enabled, uint256 _amount)
        external
        onlyOwner
    {
        swapEnabled = _enabled;
        swapThreshold = _amount;
    }
}
"
